import React from "react";
import Navigation from "../composent/Navigation";
import "../Style/Style.css";
import logo from './logo_webcup.webp'
import logo2 from './14.png'

const Home = () => {
  return (
    <div>
      <Navigation />
      <h1 className="title">Accueil</h1>
      <img src={logo} alt='La maison jungle' className='large-image' />
      <img src={logo2} alt='La maison jungle' className='large-image2' />
    </div>
  );
};

export default Home;
